import React from "react";
import action from "./images/action.png";
import Drama from "./images/Drama.png";
import Romance from "./images/Romance.png";
import Thriller from "./images/Thriller.png";
import Western from "./images/Western.png";
import Horror from "./images/Horror.png";
import Fantasy from "./images/Fantasy.png";
import music from "./images/music.png";
import Fiction from "./images/Fiction.png";
import alert from ""

const Onboarding = () => {
  return (
    <div>
      <h1>Super App</h1>
      <div>
        <h2>Choose your Entertainment Category</h2>
      </div>
      <div>
      <img src={action} alt="not found" />
      <img src={Drama} alt="not found" />
      <img src={Romance} alt="" />
      <img src={Thriller} alt="" />
      <img src={Western} alt="" />
      <img src={Horror} alt="" />
      <img src={Fantasy} alt="" />
      <img src={music} alt="" />
      <img src={Fiction} alt="" />
      </div>
       <img src={alert} alt="" />
      <p>Minimum 3 Category Required</p>
      <button>Next Page</button>
      </div>
  );
};

export default Onboarding;
